wait()
runDummyScript(function()
local switch = script.Parent
local gunBarrelOne = script.Parent.Parent.GunBarrel.One
local gunBarrelTwo = script.Parent.Parent.GunBarrel.Two

local debounce = false
local gunOne = true

local cannonBall = Instance.new("Part")
cannonBall.Size = Vector3.new(2,2,2)
cannonBall.BrickColor = BrickColor.new(102) -- medium blue
cannonBall.Shape = 0
cannonBall.BottomSurface = 0
cannonBall.TopSurface = 0
cannonBall.Name = "Cannon Shot"
cannonBall.Elasticity = .1
cannonBall.Reflectance = .2
cannonBall.Friction = 1

function getPlayer(humanoid)
	-- find the owning player of a humanoid.
	local players = game.Players:children()
	for i = 1, #players do
		if players[i].Character ~= nil then
			if players[i].Character.Humanoid == humanoid then return players[i] end
		end
	end
	return nil
end

function fire(player)

	local sound = script.Parent:findFirstChild("GunSound")
	if sound == nil then
		sound = Instance.new("Sound")
		sound.Name = "GunSound"
		sound.SoundId = "rbxasset://sounds\\Rocket shot.wav"
		sound.Volume = 1
		sound.Parent = script.Parent
	end
	sound:play()



	
	local missile = Instance.new("Part")


	local barrel

	if gunOne == true then
		barrel = gunBarrelOne
		gunOne = false
	else
		barrel = gunBarrelTwo
		gunOne = true
	end

	if (barrel.Position - switch.Parent.Base.Position).magnitude > 22 then return end -- Blown up guns don't shoot. Usually.
	

	local spawnPos = barrel.CFrame * Vector3.new(6, 0, 0)

	local dx = math.random(-10,10)
	local dy = math.random(-10,10)
	local dz = math.random(-10,10)
	local mag = math.random(180,260)

	local v = barrel.CFrame:vectorToWorldSpace(Vector3.new(mag + dx,dy,dz))
	
	local missile = cannonBall:clone()

	missile.Position = spawnPos
	missile.Velocity = v


	
	local new_script = script.Parent.CannonBall:clone()
	new_script.Disabled = false
	new_script.Parent = missile

	local creator_tag = Instance.new("ObjectValue")
	creator_tag.Value = player
	creator_tag.Name = "creator"
	creator_tag.Parent = missile
	


	missile.Parent = game.Workspace

end

function onTouched(hit)
	local humanoid = hit.Parent:findFirstChild("Humanoid")
	if humanoid~=nil and debounce == false then
		debounce = true
		switch.BrickColor = BrickColor.new(21)
		local player = getPlayer(humanoid)
		-- let slip the dogs of war
		fire(player)
		wait(.2)
		fire(player)
		wait(.2)
		fire(player)
		wait(.2)
		fire(player)

		wait(3)
		debounce = false
		switch.BrickColor = BrickColor.new(37)
	end
end


script.Parent.Touched:connect(onTouched)



end,o2130)
